import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { GET_USER_PROCESS } from '../redux-saga/user/action/useraction'

const User = () => {
    const result = useSelector((state)=>state.product_reducer)
    const dispatch = useDispatch()
    useEffect(()=>{
        dispatch({type:GET_USER_PROCESS})
    },[])
    console.log(result,"User.jsx");
  return (
    <>
    {
        result.data?.map((val)=>{
            return(
                <>
                <h1>{val.username}</h1>
                <h1>{val.password}</h1>
                </>
            )
        })
    }
    {
        result.mydata?.map((val)=>{
            return(
                <>
                <h1>{val.username}</h1>
                </>
            )
        })
    }
    </>
  )
}

export default User
